/***************************************************************************
 * Preprocess data
 **************************************************************************/

// set counts for each region
for(var regionSource in data.kraje) {
    regions.features.forEach(function (regionTarget) {
        if (regionSource == regionTarget.properties.name) {
            regionInfo[regionTarget.properties.id].count = data.kraje[regionSource]
        }
    });
}

// set counts for each district
districts.features.forEach(function(feature) {
    var districtName = feature.properties.NM3;
    count = data.okresy[districtName];
    if (count) {
        feature.properties.count = count;
    } else if (districtName == "Bratislava I") {
        feature.properties.count = data.okresy["Bratislava"];
    } else if (districtName == "Košice I") {
        feature.properties.count = data.okresy["Košice"];
    }
})

/***************************************************************************
 * Create a map
 **************************************************************************/
function createMap(elementId, options) {
    var map = L.map(elementId, {
        center: [48.69, 19.7],
        maxZoom: 16,
        zoomSnap: 0,
        zoomControl: false,
        boxZoom: false,
        doubleClickZoom: false,
        markerZoomAnimation: false,
        fadeAnimation: false,
        zoomAnimation: false,
        scrollWheelZoom: false,
        dragging: false
    });

    /***************************************************************************
     * Handle browser window resize which causes map size change
     **************************************************************************/
    function fitMap(){
        map.fitBounds(skBounds);
    }

    /***************************************************************************
     * Zoom to bounds of Slovakia
     **************************************************************************/
    var skLayer = L.geoJson(slovakia);
    var skBounds = skLayer.getBounds().pad(0.005);
    fitMap();

    /***************************************************************************
     * Handle browser window resize
     **************************************************************************/
    var doit;
    window.addEventListener("resize", function() {
        clearTimeout(doit);
        doit = setTimeout(fitMap, 50);
    });

    /***************************************************************************
     * Add optional map features
     **************************************************************************/
    if (options) {
        if (options.tiles) {
            /***************************************************************************
             * Optionally add tiles
             **************************************************************************/
            L.tileLayer(options.tiles.urlTemplate, options.tiles.options).addTo(map);
        }
        if (options.bigImage) {
            // add support to export map to image
            L.control.bigImage(options.bigImage).addTo(map);
        }
        if (options.overlays) {
            options.overlays.forEach(function(overlay){
                overlay(map, options);
            })
        }
    }

    return map;
}


/***************************************************************************
 * Regions overlay
 ***************************************************************************/
function regionsOverlay(map, options) {
    // region options or empty options object
    var regionOptions = options.regionsOverlay || {};
    // Use defined color scheme function or always return 'none' as fillColor
    var colorScheme = regionOptions.colorScheme || function(e) {return "none"} ;
    function style(feature) {
        // console.log(feature.properties.id);
        // console.log( colorScheme[feature.properties.id]);
        return {
            fillColor: colorScheme(feature),
            weight: 1,
            opacity: 1,
            color: '#b3b3b3',
            dashArray: '3',
            fillOpacity: 0.6
        };
    }

    var layer = L.geoJson(regions, {style: style});
    layer.addTo(map);

    /***************************************************************************
     * Add label as an SVG overlay
     **************************************************************************/
    function addRegionLabel(layer) {
        var props = layer.feature.properties;
        var svgElement = document.createElementNS("http://www.w3.org/2000/svg", "svg");
        svgElement.setAttribute('xmlns', "http://www.w3.org/2000/svg");
        svgElement.setAttribute('viewBox', "0 0 150 50");
        svgElement.innerHTML = '<foreignObject x="0" y="0" width="150" height="50"><div class="map-region-label">'+props.label+'<div></foreignObject>';
        L.svgOverlay(svgElement, props.labelBounds).addTo(map);
    }

    /***************************************************************************
     * Loop though region layers and add labels
     **************************************************************************/
    if (!regionOptions.hideLabels) {
        layer.eachLayer(function (layer) {
            addRegionLabel(layer);
        });
    }
}

/***************************************************************************
 * Districts overlay
 ***************************************************************************/
function districtsOverlay(map, options) {
    var options = options.districtsOverlay || {};
    function style(feature) {
        return {
            fillColor: '#e8eaed',
            weight: 1,
            opacity: 1,
            color: '#b3b3b3',
            dashArray: '3',
            fillOpacity: 0.6
        };
    }

    var layer = L.geoJson(districts, {style: style});
    layer.addTo(map);

    layer.eachLayer(function (layer) {
        var count = layer.feature.properties.count;
        if (count) {
            var center = layer.getCenter();
            options['sizeRatio'] = 0.8;
            options['count'] = count;
            options['pos'] = center;
            var name = layer.feature.properties.NM3;
            if (name == 'Bratislava I') name = 'Bratislava';
            if (name == 'Košice I') name = 'Košice';
            options['name'] = name;
            options.method(map,options);
        }
    });

}

/***************************************************************************
 * Number in a circle - used leaflet-labeled-circle library
 **************************************************************************/
function addInfoLabeledCircle(map, props) {
    // var props = krajeProps[layer.feature.properties.shortName];
    options = {
        markerOptions: {
            radius: 16,
            color: 'red',
            opacity: 0.6,
            draggable: true
        },
        anchorOptions: { color: 'red', radius: 1 },
        lineOptions: { color: 'gray', weight: 1 }
    };
    data = {
        type: "Feature",
        properties: {
            text: props.count
        }
    };
    if (props.radius) options.markerOptions.radius = props.radius;
    if (props.color) options.markerOptions.color = props.color;
    if (props.opacity) options.markerOptions.opacity = props.opacity;
    if (props.anchorColor) options.anchorOptions.color = props.anchorColor;
    if (props.lineColor) options.lineOptions.color = props.lineColor;
    var marker = L.labeledCircleMarker(props.pos, data, options);
    map.addLayer(marker);
    if (props.name) {
        marker.bindTooltip(props.name + ": " + props.count, {
            direction: 'auto',
            offset: [12, 0]
        });
    }
    return marker;
}

function logCircle(val) {
    if (val<16) return val;
    var base = Math.log(2);
    var scale = 5;
    var res = (Math.log(val/2)/base) * scale ;
    // console.log("val", val, "res", res);
    return res;
}

/***************************************************************************
 * Circle of size representing count - used leaflet-labeled-circle library
 **************************************************************************/
function varSizeCircleLabeledCircle(map, props) {
    var radius = logCircle(props.count);
    options = {
        markerOptions: {
            radius: radius,
            color: 'red',
            opacity: 0.9,
            fillOpacity: 0.9,
            draggable: true
        },
        anchorOptions: { color: 'red', radius: 1 },
        lineOptions: { color: 'gray', weight: 1 }
    };
    data = {
        type: "Feature",
        properties: {
            text: ""
        }
    };
    if (props.radius) options.markerOptions.radius = props.radius;
    if (props.color) options.markerOptions.color = props.color;
    if (props.opacity) options.markerOptions.opacity = props.opacity;
    if (props.fillOpacity) options.markerOptions.fillOpacity = props.fillOpacity;
    if (props.anchorColor) options.anchorOptions.color = props.anchorColor;
    if (props.lineColor) options.lineOptions.color = props.lineColor;
    var marker = L.labeledCircleMarker(props.pos, data, options);
    map.addLayer(marker);
    marker.bindTooltip(props.name + ": " + props.count, {
        direction: 'auto',
        offset: [radius,0]
    });
    return marker;
}

/****************************************************************************************
 * Number in a circle - used SvgOverlay - circle is resized with the map
 ****************************************************************************************/
function addInfoSvgOverlay(map, props) {
    var svgElement = document.createElementNS("http://www.w3.org/2000/svg", "svg");
    svgElement.setAttribute('xmlns', "http://www.w3.org/2000/svg");
    svgElement.setAttribute('viewBox', "0 0 50 50");
    svgElement.innerHTML =
        '<circle cx="25" cy="25" r="25" stroke="none" stroke-width="0" fill="#ff6600" fill-opacity="0.6"/>' +
        '<circle cx="25" cy="25" r="19" stroke="none" stroke-opacity="0.7" stroke-width="0" fill="#ff6600" fill-opacity="0.8"/>' +
        '<text fill="#3b3b3b" x="50%" y="50%" text-anchor="middle" dy=".4em" font-size="1.8em" font-weight="500">' + props.count + '</text>';
    // console.log(props)
    var c = L.latLng(props.pos);
    var pad = 0.15 * props.sizeRatio;
    var bounds = [[c.lat - pad, c.lng - pad], [c.lat + pad, c.lng + pad]];
    var marker = L.svgOverlay(svgElement, bounds);
    marker.addTo(map);
    return marker;
}

/***************************************************************************
 * Number in a circle - used DivIcon component
 **************************************************************************/
function addInfoDivIcon(map, props) {
    var outerCircleStyle = 'map-marker-circle2';
    var innerCircleStyle = 'map-marker-circle3';
    if (props.innerCircleStyle) innerCircleStyle = props.innerCircleStyle;
    if (props.outerCircleStyle) outerCircleStyle = props.outerCircleStyle;

    var icon = L.divIcon({
        className: 'map-marker-circle1',
        iconSize: [50, 50],
        html: '<div class="'+outerCircleStyle+'"><div class="'+innerCircleStyle+'">'+props.count+'</div></div>'
    });
    var marker = L.marker(props.pos, {icon: icon});
    marker.addTo(map);
    if (props.name) {
        marker.bindTooltip(props.name + ": " + props.count, {
            direction: 'auto',
            offset: [12, 0]
        });
    }
    return marker;
}

/***************************************************************************
 * Circle of size representing count - used DivIcon component
 **************************************************************************/
function varSizeCircleDivIcon(map, props) {
    var outerCircleStyle = 'map-marker-circle-outer';
    var innerCircleStyle = 'map-marker-circle-inner';
    if (props.innerCircleStyle) innerCircleStyle = props.innerCircleStyle;
    if (props.outerCircleStyle) outerCircleStyle = props.outerCircleStyle;

    var radius = logCircle(props.count);
    var icon = L.divIcon({
        className: outerCircleStyle,
        iconSize: [2*radius, 2*radius],
        html: '<div class="'+innerCircleStyle+'"></div>'
    });
    var marker = L.marker(props.pos, {icon: icon});
    marker.addTo(map);
    marker.bindTooltip(props.name + ": " + props.count, {
        direction: 'auto',
        offset: [radius,0]
    });
    return marker;
}

